@Karnav123 
Would u mind share the model along with the inferencing script used?
In the meantime maybe you want to try onnxruntime 1.4.0.

@RandySheriffH  The model can be accessed from https://github.com/Karnav123/onnx_model/blob/master/Model_XGB.onnx

To infer this Model I am using the following script. Although I can not give the whole script here because it is written in a OOPs way spanning across multiple file. To load the model: 

`
void Model::SetModel(const string& modelPath)
{
    const ORTCHAR_T* onnxModelPath = nullptr;
#ifdef WNT
    onnxModelPath = ToUnicode(modelPath);
#else
    onnxModelPath = modelPath.utf8_str();
#endif
    
    // ONNX runtime specific logging level. Should be static
    static Ort::Env env(ORT_LOGGING_LEVEL_WARNING, "onnx_loader");

    Ort::SessionOptions sessionOptions;
    sessionOptions.SetIntraOpNumThreads(8);

      // Fixed crash when the prediction data is too big
    // Fixed inconsistent behavior in first prediction in session
    sessionOptions.DisableCpuMemArena();
    sessionOptions.DisableMemPattern();

    sessionOptions.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_EXTENDED);

    try
    {
        this->m_onnxModel = new Ort::Session(env, onnxModelPath, sessionOptions);
    }
    catch (const Ort::Exception& exception)
    {
      // Print error
    }
}`

